function output = sysf_water_swimmer(input_mode)

	% Default arguments
	if ~exist('input_mode','var')
		
		input_mode = 'name';
		
	end
	
	%%%%%%%
	
	switch input_mode

		case 'name'

			output = 'High Re 3-link ideal'; % Display name

		case 'dependency'

			output.dependency = {};

		case 'initialize'

			%%%%%

			%Functional representation of local connection
			s.A_num = @Conn_num;

			%%%
			%Processing details

			%Mark that system has a singularity that needs to be accounted for
			s.singularity = 0;

			%Range over which to evaluate connection
			s.grid_range = [-1,1,-1,1]*2.5;

			%densities for various operations
			s.density.vector = [11 11]; %density to display vector field
			s.density.scalar = [31 31]; %density to display scalar functions
			s.density.eval = [31 31];   %density for function evaluations
			s.finite_element_density = 31;
			% power metric
			s.metric = @honey_power_metric;

			%%%
			%Display parameters

			%shape space tic locations
			s.tic_locs.x = [-1 0 1]*1.5;
			s.tic_locs.y = [-1 0 1]*1.5;
			


			%%%%
			%Save the system properties
			output = s;

	end

end

